import React from "react";

import OutoutMain from "./OutoutMain";
import OutputVersus from "./OutputVersus";
import OutputMaintenance from "./OutputMaintenance";
import OutputTCO from "./OutputTCO";
import OutputBreakeven from "./OutputTCO";

const Outputs = ({
  pricing,
  totalMonthlyPaaSPowerCost,
  totalMonthlyPaaSMaintenanceCost,
  requiredEquipment,
  breakeven,
  reductionFromNGBRResale,
  gasZTR,
  cashPurchase,
  NGBRWithFlexiblePowerProgram,
  numberOfMaintenanceJobsPerYear,
  averageTotalTimeForServicing,
  monthlyPaaSPowerCostNGBR,
  customerInputs,
  monthlyFuelCostPerZTR,
  monthlyMaintenanceCostPerNGBR,
  monthlyMaintenanceCostPerZTR,
  enviromentalBenefits,
  poundsOfCO2Avoided,
  whichStep,
}) => {
  return (
    <>
      <OutoutMain {...{ pricing, requiredEquipment }} />

      <OutputVersus
        {...{
          monthlyPaaSPowerCostNGBR,
          customerInputs,
          monthlyFuelCostPerZTR,
          monthlyMaintenanceCostPerNGBR,
          monthlyMaintenanceCostPerZTR,
          pricing,
        }}
      />

      <OutputMaintenance
        {...{
          numberOfMaintenanceJobsPerYear,
          averageTotalTimeForServicing,
          totalMonthlyPaaSMaintenanceCost,
          totalMonthlyPaaSPowerCost,
        }}
      />

      <OutputTCO {...{ gasZTR, cashPurchase, NGBRWithFlexiblePowerProgram }} />
    </>
  );
};

export default Outputs;
